import { environment } from "../config/environment";

export const getFolders = async () =>{
    try {
        const response = await fetch(`${environment.baseUrl}/folder`, {
            method: 'GET',
            credentials: 'same-origin'
        });
        const exam = await response.json();
        return exam;
    } catch (error) {
        console.error(error);
    }
}
